Кому адресован и для кого предназначен журнал «Колесо Жизни»
В первую очередь для тех, кто «хочет», «может» и «будет», для тех, кто стремиться к развитию и эволюции, хочет узнать новое о себе, о других людях, хочет быть успешным, строить свое желаемое видение и т.д., и т.п.:

    * для мужчин и женщин, живущих в Украине;
    * для руководителей и собственников фирм, которым важно развитие своей команды;
    * для руководителей отделов по работе с персоналом – как инструмент для более эффективной работы;
    * для тех, кто в той либо иной степени интересуется своим развитием;
    * для людей, интересующихся практиками саморазвития, философией, психологией, коучингом, эзотерикой и т.п.;
    * для желающих заниматься самосовершенствованием и самообразованием;
    * для тех, кто любит, хочет и может читать развивающую литературу и готов инвестировать в это деньги;
    * для тех людей, для которых гармоничное состояние и самочувствие важнее внешнего;
    * для тех, кто устал от рекламы, секса на страницах журналов, сцен насилия в фильмах и новостях и другого негатива;
    * для людей, которые открыты миру;
    * для специалистов различных профессий гуманитарного и педагогического профиля, медицинских работников, преподавателей вузов, а также студентов;
    * …

А также для тех:

    * кто хочет подарить журнал «Колесо Жизни» кому-либо из своих знакомых;
    * кто выбрал своим хобби психологию, эзотерику и т.д.;
    * кто стремится к саморазвитию, будучи «активной» домохозяйкой и т.п.
